def enhanced_char_count(s):
    vowels = ''
    consonants = 'bcdfghjklmnpqrstvwxyz'
    letters = vowels + consonants
    special_characters = "!@#$%^&*()-_=+[]{}|;:',.<>/?`~"
    digit = '0123456789'
    vowels_freq = {}
    consonants_freq = {}
    digits = {}
    special = 0
    for char in s.lower():
        if char in vowels:
            vowels_freq[char] = vowels_freq.get(char, 0) + 1
        elif char in consonants:
            consonants_freq[char] = consonants_freq.get(char, 0) + 1
        elif char in digit:
            digits[char] = digits.get(char, 0) + 1
        elif char in special_characters:
            special += 1
    freqs = vowels_freq.copy()
    freqs.update(consonants_freq)
    freqs.update(digits)
    highest_frequency = {k: v for (k, v) in freqs.items() if v == max(freqs.values())}
    lowest_frequency = {k: v for (k, v) in freqs.items() if v == min(freqs.values())}
    result = {'Letters': {'Vowels': vowels_freq, 'Consonants': consonants_freq}, 'Digits': digits, 'Special characters': special, 'Highest frequency': highest_frequency, 'Lowest frequency': lowest_frequency}
    return result

